import React, { Component } from "react";

import {Switch, Route } from "react-router-dom";
import App from "./App";
import Update from "./Member/Update"

class Index extends Component {
  render() {
    return (
      
        <App>
          <Switch>
            <Route path="/account/member" component={Update} />
        
          </Switch>
        </App>
      
    )
  }
}

export default Index;
